    const random =() => {
        let random1 = Math.floor(Math.random()*Schedule.length);
        console.log("1:" + random1)
        if(Schedule[random1] === undefined){
            Schedule[random1] = Course;
            // return Schedule.length = Schedule.length;
        }else{
            random1 = Math.floor(Math.random() * Schedule.length);
        }
    }
